    `INSERT INTO uuid (fk_user_id, uuid, ttl, ttl_max) VALUES(?, ?, ?, ?)`,
    [userId, uuid, ttl, ttlMax]
  );
};

export const updateUuid = (id, uuid, ttl, ttlMax) => {
