const scraperObject = {
  async scraper(browser, url) {
    let page = await browser.newPage();
    await page.goto(url);

    const [age20] = await page.$x(
      "//button[contains(., 'Jag har fyllt 20 år')]"
    );
    if (age20) {
      await age20.click();
    }
    page.waitForTimeout(100);

    const [cookiePls] = await page.$x("//button[contains(., 'SPARA & STÄNG')]");
    if (cookiePls) {
      await cookiePls.click();
    }
    page.waitForTimeout(100);

    const [letMeBrowse] = await page.$x(
      "//button[contains(., 'ta mig direkt till onlinebutiken')]"
    );
    if (letMeBrowse) {
      await letMeBrowse.click();
    }
    while (await page.$x("//button[contains(., 'Visa fler')]")) {
      for (let index = 0; index < 30; index++) {
        await page.waitForTimeout(50).then(async () => {
          await page.mouse.wheel({ deltaY: 400 });
        });
      }
      const [showMore] = await page.$x("//button[contains(., 'Visa fler')]");
      if (showMore) {
        await showMore.click();
        page.waitForTimeout(100);
      } else {
        for (let index = 0; index < 15; index++) {
          await page.waitForTimeout(150).then(async () => {
            await page.mouse.wheel({ deltaY: 800 });
          });
        }
        break;
      }
    }

    await page.waitForSelector("#mainContent .container>.row");

    for (let index = 0; index < 15; index++) {
      await page.waitForTimeout(100).then(async () => {
        await page.mouse.wheel({ deltaY: 800 });
      });
    }
    page.waitForTimeout(300);
    const wines = await page.$$eval(
      ".container>.row div:nth-child(1)>div:nth-child(1)>a",
      () =>
        Array.from(
          document.querySelectorAll(
            ".container>.row div:nth-child(1)>div:nth-child(1)>a"
          )
        ).map((elem) => {
          return elem.outerHTML;
        })
    );

    // const wines = await page.$$eval(
    //   "#mainContent main>div:nth-child(3)>div:nth-child(2)>div:nth-child(2)>div:nth-child(1)>div:nth-child(2)>div>>div:nth-child(2)>div>div>div>a",
    //   () =>
    //     Array.from(
    //       document.querySelectorAll(
    //         "#mainContent main>div:nth-child(3)>div:nth-child(2)>div:nth-child(2)>div:nth-child(1)>div:nth-child(2)>div>>div:nth-child(2)>div>div>div>a"
    //       )
    //     ).map((elem) => {
    //       return elem.outerHTML;
    //     })
    // );
    await browser.close();
    return wines;
  },
};

module.exports = scraperObject;

